import React, { useState, useEffect } from 'react';
import axios from 'axios';

const EmergencyRequestTest = () => {
  const [emergencyRequests, setEmergencyRequests] = useState([]);
  const [loading, setLoading] = useState(false);
  const [testResults, setTestResults] = useState([]);

  const addTestResult = (test, success, message, details = null) => {
    setTestResults(prev => [...prev, {
      test,
      success,
      message,
      details,
      timestamp: new Date().toISOString()
    }]);
  };

  const clearTestResults = () => {
    setTestResults([]);
  };

  const testFetchEmergencyRequests = async () => {
    try {
      setLoading(true);
      addTestResult('Fetch Emergency Requests', 'pending', 'Fetching emergency requests...');
      
      const response = await axios.get('http://localhost:5000/emergency-requests/all', {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });
      
      setEmergencyRequests(response.data.data || []);
      addTestResult('Fetch Emergency Requests', 'success', `Found ${response.data.data?.length || 0} requests`, response.data);
    } catch (error) {
      addTestResult('Fetch Emergency Requests', 'error', 'Failed to fetch requests', {
        error: error.message,
        response: error.response?.data
      });
    } finally {
      setLoading(false);
    }
  };

  const testUpdateRequestStatus = async (requestId, status) => {
    try {
      addTestResult(`Update Status to ${status}`, 'pending', `Updating request ${requestId} to ${status}...`);
      
      const response = await axios.put(`http://localhost:5000/emergency-requests/${requestId}/status`, {
        status,
        adminNotes: `Test update to ${status}`
      }, {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });
      
      addTestResult(`Update Status to ${status}`, 'success', `Successfully updated to ${status}`, response.data);
      
      // Refresh the list
      testFetchEmergencyRequests();
    } catch (error) {
      addTestResult(`Update Status to ${status}`, 'error', `Failed to update to ${status}`, {
        error: error.message,
        response: error.response?.data,
        requestId
      });
    }
  };

  const testFindNearestBranch = async (requestId) => {
    try {
      const request = emergencyRequests.find(req => req._id === requestId);
      if (!request || !request.coordinates) {
        addTestResult('Find Nearest Branch', 'error', 'No coordinates available for request', { requestId });
        return;
      }

      addTestResult('Find Nearest Branch', 'pending', `Finding nearest branch for request ${requestId}...`);
      
      const response = await axios.post('http://localhost:5000/emergency-requests/find-nearest-branch', {
        lat: request.coordinates.lat,
        lng: request.coordinates.lng
      }, {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        }
      });
      
      addTestResult('Find Nearest Branch', 'success', `Found ${response.data.data?.length || 0} nearby branches`, response.data);
    } catch (error) {
      addTestResult('Find Nearest Branch', 'error', 'Failed to find nearest branch', {
        error: error.message,
        response: error.response?.data,
        requestId
      });
    }
  };

  const testCreateEmergencyRequest = async () => {
    try {
      addTestResult('Create Emergency Request', 'pending', 'Creating test emergency request...');
      
      const testRequest = {
        brigadeId: 'TEST_BRIGADE_001',
        brigadeName: 'Test Fire Brigade',
        brigadeLocation: 'Test Location',
        requestType: 'Emergency Water Supply',
        priority: 'High',
        waterLevel: '30%',
        description: 'Test emergency request for debugging',
        coordinates: {
          lat: 6.9271,
          lng: 79.8612
        }
      };
      
      const response = await axios.post('http://localhost:5000/emergency-requests/create', testRequest);
      
      addTestResult('Create Emergency Request', 'success', 'Test request created successfully', response.data);
      
      // Refresh the list
      testFetchEmergencyRequests();
    } catch (error) {
      addTestResult('Create Emergency Request', 'error', 'Failed to create test request', {
        error: error.message,
        response: error.response?.data
      });
    }
  };

  useEffect(() => {
    testFetchEmergencyRequests();
  }, []);

  return (
    <div className="p-6 max-w-6xl mx-auto">
      <h1 className="text-2xl font-bold mb-6">Emergency Request System Test</h1>
      
      {/* Test Controls */}
      <div className="bg-white rounded-lg shadow p-6 mb-6">
        <h2 className="text-lg font-semibold mb-4">Test Controls</h2>
        <div className="flex flex-wrap gap-4">
          <button
            onClick={testFetchEmergencyRequests}
            disabled={loading}
            className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600 disabled:opacity-50"
          >
            {loading ? 'Loading...' : 'Refresh Requests'}
          </button>
          <button
            onClick={testCreateEmergencyRequest}
            className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600"
          >
            Create Test Request
          </button>
          <button
            onClick={clearTestResults}
            className="bg-gray-500 text-white px-4 py-2 rounded hover:bg-gray-600"
          >
            Clear Test Results
          </button>
        </div>
      </div>

      {/* Emergency Requests List */}
      <div className="bg-white rounded-lg shadow p-6 mb-6">
        <h2 className="text-lg font-semibold mb-4">Emergency Requests ({emergencyRequests.length})</h2>
        {emergencyRequests.length === 0 ? (
          <p className="text-gray-500">No emergency requests found.</p>
        ) : (
          <div className="space-y-4">
            {emergencyRequests.map((request) => (
              <div key={request._id} className="border rounded-lg p-4">
                <div className="flex justify-between items-start mb-2">
                  <div>
                    <h3 className="font-semibold">{request.brigadeName}</h3>
                    <p className="text-sm text-gray-600">ID: {request._id}</p>
                    <p className="text-sm text-gray-600">Status: {request.status}</p>
                    <p className="text-sm text-gray-600">Priority: {request.priority}</p>
                  </div>
                  <div className="flex gap-2">
                    {request.status === 'Pending' && (
                      <>
                        <button
                          onClick={() => testUpdateRequestStatus(request._id, 'Approved')}
                          className="bg-green-500 text-white px-3 py-1 rounded text-sm hover:bg-green-600"
                        >
                          Approve
                        </button>
                        <button
                          onClick={() => testUpdateRequestStatus(request._id, 'Rejected')}
                          className="bg-red-500 text-white px-3 py-1 rounded text-sm hover:bg-red-600"
                        >
                          Reject
                        </button>
                      </>
                    )}
                    <button
                      onClick={() => testFindNearestBranch(request._id)}
                      className="bg-blue-500 text-white px-3 py-1 rounded text-sm hover:bg-blue-600"
                    >
                      Find Branch
                    </button>
                  </div>
                </div>
                <p className="text-sm text-gray-700">{request.description}</p>
                {request.coordinates && (
                  <p className="text-xs text-gray-500">
                    Coordinates: {request.coordinates.lat}, {request.coordinates.lng}
                  </p>
                )}
              </div>
            ))}
          </div>
        )}
      </div>

      {/* Test Results */}
      <div className="bg-white rounded-lg shadow p-6">
        <h2 className="text-lg font-semibold mb-4">Test Results ({testResults.length})</h2>
        <div className="space-y-2 max-h-96 overflow-y-auto">
          {testResults.map((result, index) => (
            <div
              key={index}
              className={`p-3 rounded border ${
                result.success === 'success' ? 'bg-green-50 border-green-200' :
                result.success === 'error' ? 'bg-red-50 border-red-200' :
                'bg-yellow-50 border-yellow-200'
              }`}
            >
              <div className="flex justify-between items-start">
                <div>
                  <p className="font-medium">{result.test}</p>
                  <p className="text-sm text-gray-600">{result.message}</p>
                  <p className="text-xs text-gray-500">{new Date(result.timestamp).toLocaleTimeString()}</p>
                </div>
                <span className={`px-2 py-1 rounded text-xs ${
                  result.success === 'success' ? 'bg-green-200 text-green-800' :
                  result.success === 'error' ? 'bg-red-200 text-red-800' :
                  'bg-yellow-200 text-yellow-800'
                }`}>
                  {result.success}
                </span>
              </div>
              {result.details && (
                <details className="mt-2">
                  <summary className="text-sm text-gray-600 cursor-pointer">View Details</summary>
                  <pre className="text-xs bg-gray-100 p-2 rounded mt-1 overflow-x-auto">
                    {JSON.stringify(result.details, null, 2)}
                  </pre>
                </details>
              )}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default EmergencyRequestTest;
